class Solution:
    def findAnagrams(self, s, p):
        template = {}
        for c in p:
            if c not in template:
                template[c] = 0
            template[c] += 1

        ans = []
        current = {}
        begin = end = 0
        
        while end < len(s):
            if s[end] not in current:
                current[s[end]] = 0
            current[s[end]] += 1

            if end >= len(p) - 1:
                if current == template:
                    ans.append(begin)

                current[s[begin]] -= 1
                if current[s[begin]] == 0:
                    del current[s[begin]]
                begin += 1
            end += 1

        return ans


    def findAnagrams2(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        if s == "" or p == "":
            return []

        p = list(p)
        s = list(s)

        key = sorted(p)

        def is_anagram(c):
            nonlocal key
            return key == sorted(c)

        ans = []
        for i in range(len(s) - len(p) + 1):
            if is_anagram(s[i : i + len(p)]):
                ans.append(i)
        return ans


###############################################################
import unittest


class TestFunctions(unittest.TestCase):
    def test_1(self):
        s = Solution()
        self.assertEqual([0, 6], s.findAnagrams("cbaebabacd", "abc"))
        self.assertEqual([0, 1, 2], s.findAnagrams("abab", "ab"))
        self.assertEqual([0, 2], s.findAnagrams("abab", "a"))
        self.assertEqual([], s.findAnagrams("abab", ""))
        self.assertEqual([], s.findAnagrams("", "abab"))

        self.assertEqual(
            [0, 10001],
            s.findAnagrams(
                "",
                "",
            ),
        )


if __name__ == "__main__":
    unittest.main()
